def if_decimal_is_divisible(binary):
    def fibonacci(n):
        if n <= 1:
            return n
        else:
            return fibonacci(n-1) + fibonacci(n-2)

    decimal = int(binary, 2)
    fibonacci_24 = fibonacci(24)

    if decimal % fibonacci_24 == 0:
        return True
    else:
        return False
```
Note: This code assumes that the input binary string is a valid binary representation of a non-negative decimal integer.
